import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';
import Home from './components/Home.js';
import {Routes, Route} from "react-router-dom";


function App() {
  return (
    <div className='App-header'>
      <Navbar/>
      <Routes>
        <Route path="/home" element={<Home/>}/>
      </Routes>

    </div>
  );
}

export default App;
